dispatch:
- url: "api.cyph.com/*"
  module: default

- url: "cyph.com/*"
  module: nakedredirect

- url: "www.cyph.com/*"
  module: cyph-com

- url: "cyph.im/*"
  module: cyph-im

- url: "cyph.me/*"
  module: cyph-me

- url: "cyph.video/*"
  module: cyph-video

- url: "cyph.audio/*"
  module: cyph-audio
